import React, {useState} from "react";
import {Accordion, Card} from "react-bootstrap";
import './Category.css';
import { useAccordionToggle } from "react-bootstrap/AccordionToggle";
import AccordionContext from "react-bootstrap/AccordionContext";

// reactstrap components
import {
    Button
} from "reactstrap";
import Item from "../Item/Item";
import ItemForm from "../Item/ItemForm/ItemForm";
import CategoryForm from "./CategoryForm/CategoryForm";

function CustomToggle({ children, eventKey, callback }) {
    const currentEventKey = React.useContext(AccordionContext);
    const decoratedOnClick = useAccordionToggle(
        eventKey,
        () => callback && callback(eventKey)
    );
    const isCurrentEventKey = currentEventKey === eventKey;
    return (
        <span
            className="p-3"
            style={{
                cursor: "pointer",
                backgroundColor: isCurrentEventKey ?  "#d5d8de" : "#e6e9f0",
                color: isCurrentEventKey ? "white" : "white"}}
            onClick={decoratedOnClick}
        >
            {children}
        </span>
    );
}

const Category = (props) => {
    let [itemFormModal, setItemFormModal] = useState(false);
    let [editCategoryModal, setEditCategoryModal] = useState(false);

    let toggleItemForm = (event) => {
        event.stopPropagation();
        setItemFormModal(!itemFormModal);
    }

    let toggleCategoryForm = (event) => {
        event.stopPropagation();
        setEditCategoryModal(!editCategoryModal);
    }

    let deleteEvent = (event) => {
        event.stopPropagation();
    }

    const items = [
        { id: 1, itemName: "Cheeseburger", itemDescription: "Burger so kaskaval", itemImage: "data:image/jpeg;base64,"},
        { id: 2, itemName: "Regular", itemDescription: "Obicen burger", itemImage: "data:image/jpeg;base64,"},
        { id: 3, itemName: "Big Mac", itemDescription: "Burger so 2 pleskavici", itemImage: "data:image/jpeg;base64,"},
        { id: 4, itemName: "Makedonski", itemDescription: "Makedonski so Sharska", itemImage: "data:image/jpeg;base64,"}
    ];

    return(
        <>
            <Accordion className="container shadow-sm p-0 mb-2 bg-white rounded"
                       key={props.id}
                       defaultActiveKey={props.id}>
                <Card>
                    <CustomToggle
                        eventKey={props.id}>
                        <div>
                            <div className="float-left">
                                <h5 style={{paddingTop: 5}}>{props.categoryName}</h5>
                            </div>
                            <div className="float-right">
                                <Button className="btn btn-info"
                                        onClick={(event) => toggleItemForm(event)}>
                                    <span className="fa fa-plus"/>
                                </Button>
                                <ItemForm type={false}
                                          click={(event) => toggleItemForm(event)}
                                          itemFormModal={itemFormModal}/>
                                <Button className="btn btn-neutral"
                                        onClick={(event) => toggleCategoryForm(event)}>
                                    <span className="fa fa-edit"/>
                                </Button>
                                <CategoryForm type={true}
                                              click={(event) => toggleCategoryForm(event)}
                                              editCategoryModal={editCategoryModal}/>
                                <Button className="btn btn-danger"
                                        onClick={(event) => deleteEvent(event)}>
                                    <span className="fa fa-trash"/>
                                </Button>
                            </div>
                        </div>
                    </CustomToggle>
                    <Accordion.Collapse eventKey={props.id}>
                        <Card.Body className="cards">
                            {items.map(item => (
                                <Item key={item.id}
                                    item={item}/>
                            ))}
                        </Card.Body>
                    </Accordion.Collapse>
                </Card>
            </Accordion>
        </>

    );
}

export default Category;
